import heapq

class Solution:
    def shortestDistance(self, maze, start, destination):
        heap = [(0, start[0], start[1])]
        moves = [(-1, 0), (1, 0), (0,1), (0, -1)]
        seen = {(start[0], start[1]):0}

        while heap:
            curr_steps, curr_row, curr_col  = heapq.heappop(heap)
            if [curr_row, curr_col] == destination:
                return curr_steps
            
            for move in moves:
                new_row, new_col = curr_row, curr_col
                num_steps, final_row, final_col = self._roll(maze, seen, new_row, new_col, move)
                final_steps = curr_steps + num_steps 
                if (final_row, final_col) not in seen or final_steps < seen[(final_row, final_col)]:
                    seen[(final_row, final_col)] = final_steps 
                    heapq.heappush(heap, (final_steps, final_row, final_col))
                    
        return -1  
    
    
    def _roll(self, maze, seen, new_row, new_col, move):
        curr_steps = 0         
        while self._is_inbounds(maze, new_row + move[0], new_col + move[1]):
            new_row += move[0]
            new_col += move[1]
            curr_steps += 1
        return curr_steps, new_row  , new_col
        
    def _is_inbounds(self, maze, row, col):
        return 0 <= row < len(maze) and 0 <= col < len(maze[0]) and maze[row][col] != 1
                    
